DROP TABLE IF EXISTS #TempAccounts
SELECT T.*, BP.acctID, BP.AccountNumber
INTO #TempAccounts
FROM BSegment_Primary BP WITH (NOLOCK)
JOIN BSegment_Secondary BS WITH (NOLOCK) ON BP.acctID = BS.acctID
JOIN #TempData T ON (BS.ClientID = T.CLIENT_ID)

