DROP TABLE IF EXISTS #TempDisputes
SELECT T.acctID, T.DISPUTE_ID DISPUTE_NOTES, T.Account_UUID, T.CLIENT_ID, T.DISPUTE_AMOUNT, T.AccountNumber, D.DisputeID, D.PurchaseTranID
INTO #TempDisputes
FROM #TempAccounts T
JOIN DisputeLog D WITH (NOLOCK) ON (T.acctID = D.BSAcctID)

SELECT * FROM #TempDisputes WHERE DISPUTE_AMOUNT = 0

DROP TABLE IF EXISTS #TempDisputesLog
;WITH CTE
AS
(
SELECT T.*, D.DisputeTranID, D.DisputeAmount, D.TransactionLifeCycleUniqueID, D.ClaimID, D.Notes, SUBSTRING(Notes, 3, 7) Notes_Calc,
ROW_NUMBER() OVER(PARTITION BY T.PurchaseTranID ORDER BY DisputeInitiated) [Rank]
FROM #TempDisputes T
JOIN DisputeStatusLog D WITH (NOLOCK) ON (T.DisputeID = D.DisputeID)
)
SELECT *
INTO #TempDisputesLog
FROM CTE --WHERE [Rank] = 1



