DROP TABLE IF EXISTS #TempTxns
SELECt DISTINCT T1.PurchaseTranID, T1.ClaimID, T1.AccountNumber, T1.AcctID, T1.TransactionLifeCycleUniqueID
INTO #TempTxns
FROM #TempDisputesLog T1
JOIN #TempDisputesLog T2 ON (T1.DisputeID = T2.DisputeID)
WHERE T1.DISPUTE_NOTES = T2.Notes_Calc

SELECt DISTINCT T1.PurchaseTranID, T1.ClaimID, T1.AccountNumber, T1.AcctID, T1.TransactionLifeCycleUniqueID
FROM #TempDisputesLog T1
JOIN #TempDisputesLog T2 ON (T1.DisputeID = T2.DisputeID)
WHERE T1.DISPUTE_NOTES = T2.Notes_Calc

SELECt DISTINCT T1.DISPUTE_NOTES
FROM #TempDisputesLog T1
JOIN #TempDisputesLog T2 ON (T1.DisputeID = T2.DisputeID)
WHERE T1.DISPUTE_NOTES = T2.Notes_Calc

